import{_ as e,a as t}from"./chunks/load-model-modal.4ddcd969.js";import{_ as a,o,c as s,Q as i}from"./chunks/framework.70b8ae0d.js";const r="/voltaML-fast-stable-diffusion/assets/left-bar-download.a8dddd46.webp",l="/voltaML-fast-stable-diffusion/assets/download-model-1.d07d4bd3.webp",n="/voltaML-fast-stable-diffusion/assets/download-model-2.522d729c.webp",d="/voltaML-fast-stable-diffusion/assets/txt2img-button.a99913d9.webp",c="/voltaML-fast-stable-diffusion/assets/loaded-model.f642b3ae.webp",p="/voltaML-fast-stable-diffusion/assets/gen-settings.3e67113e.webp",m="/voltaML-fast-stable-diffusion/assets/progress.a29be064.webp",u="/voltaML-fast-stable-diffusion/assets/final.08b87c95.webp",M=JSON.parse('{"title":"Guide to creating your first image","description":"","frontmatter":{},"headers":[],"relativePath":"guides/first-image.md","filePath":"guides/first-image.md","lastUpdated":1701110036000}'),h={name:"guides/first-image.md"},g=i('<h1 id="guide-to-creating-your-first-image" tabindex="-1">Guide to creating your first image <a class="header-anchor" href="#guide-to-creating-your-first-image" aria-label="Permalink to &quot;Guide to creating your first image&quot;">​</a></h1><p>This guide assumes that you already have started instance of Volta (fully installed and running)</p><h2 id="download-your-first-model" tabindex="-1">Download your first model <a class="header-anchor" href="#download-your-first-model" aria-label="Permalink to &quot;Download your first model&quot;">​</a></h2><p>Click the Box icon to access the <code>Models</code> page:</p><p><img src="'+r+'" alt="Models Page"></p><p>Find a model that you like and click on it (I will use <code>Dreamshaper v8</code> for this example): <img src="'+l+'" alt="CivitAI Download"></p><p>Select a version that you want to download (the one automatically selected is usually the best one), select the format and click on the <strong>Download</strong> button:</p><div class="tip custom-block"><p class="custom-block-title">Recommendation</p><p>Use FP16 models saved in Safetensors format.</p></div><p><img src="'+n+'" alt="CivitAI Download Popup"></p><p>Wait for the download to finish (you can see the progress in the terminal window where you started Volta), notification will be displayed when the download is finished</p><p>Switch back to the <strong>Text to Image</strong> tab:</p><p><img src="'+d+'" alt="Text to Image Tab"></p><h2 id="loading-the-model" tabindex="-1">Loading the model <a class="header-anchor" href="#loading-the-model" aria-label="Permalink to &quot;Loading the model&quot;">​</a></h2><p>Now that you have downloaded the model, you can load it into Volta.</p><p>Click on the <strong>Load Model</strong> button:</p><p><img src="'+e+'" alt="Load Model Button"></p><p>Select the model you just downloaded:</p><ol><li>Click the <code>Load</code> Button</li><li>Wait for the button to change to <code>Unload</code></li></ol><p><img src="'+t+'" alt="Select Model"></p><p>Close the modal by clicking on the <code>X</code> button in the top right corner.</p><p>Model should now be loaded and selected:</p><p><img src="'+c+'" alt="Model Selected"></p><h2 id="generating-an-image" tabindex="-1">Generating an image <a class="header-anchor" href="#generating-an-image" aria-label="Permalink to &quot;Generating an image&quot;">​</a></h2><h3 id="prompt" tabindex="-1">Prompt <a class="header-anchor" href="#prompt" aria-label="Permalink to &quot;Prompt&quot;">​</a></h3><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro"><code><span class="line"><span style="color:#abb2bf;">8k portrait of beautiful cyborg with brown hair, intricate, elegant, highly detailed, majestic, digital photography, art by artgerm and ruan jia and greg rutkowski surreal painting gold butterfly filigree, broken glass, (masterpiece, sidelighting, finely detailed beautiful eyes: 1.2), hdr, (detailed background window to a new dimension, plants and flowers:0.7), &lt;lora:https://civitai.com/api/download/models/87153:0.6&gt;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You might have noticed the <code>&lt;lora:https://civitai.com/api/download/models/87153:0.6&gt;</code> at the end - this is remote LoRA model, find out more about it <a href="/voltaML-fast-stable-diffusion/basics/lora">here</a></p></div><h3 id="negative-prompt" tabindex="-1">Negative Prompt <a class="header-anchor" href="#negative-prompt" aria-label="Permalink to &quot;Negative Prompt&quot;">​</a></h3><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can make your image look a lot better with the use of <a href="/voltaML-fast-stable-diffusion/basics/textual-inversion">textual inversions</a> like <a href="https://civitai.com/models/72437/baddream-unrealisticdream-negative-embeddings" target="_blank" rel="noreferrer">Bad Dream</a> or <a href="https://civitai.com/models/7808?modelVersionId=9208" target="_blank" rel="noreferrer">Easy Negative</a></p></div><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro"><code><span class="line"><span style="color:#abb2bf;">(worst quality, low quality:1.4), nsfw</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="sampler" tabindex="-1">Sampler <a class="header-anchor" href="#sampler" aria-label="Permalink to &quot;Sampler&quot;">​</a></h3><blockquote><p>Pick one of the samplers from the dropdown menu. My favourite is <strong>DPM++ 2S a</strong> and <strong>DPM++ 2M</strong></p></blockquote><h3 id="sigmas" tabindex="-1">Sigmas <a class="header-anchor" href="#sigmas" aria-label="Permalink to &quot;Sigmas&quot;">​</a></h3><blockquote><p>I will use <strong>Exponential</strong> for this example, but it is a personal preference, experiment with different sigmas to get different results.</p></blockquote><hr><p><img src="'+p+'" alt="Generate Settings"></p><p>Now that you set your inputs, click on the <strong>Generate</strong> button. Wait for the image to generate. You can see progress in the UI or in the terminal window where you started Volta.</p><p><img src="'+m+'" alt="Progress"></p><h2 id="final-result" tabindex="-1">Final result <a class="header-anchor" href="#final-result" aria-label="Permalink to &quot;Final result&quot;">​</a></h2><p><img src="'+u+'" alt="Generated Image"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Image generated in this example has some visual artifacts, but it should provide a good <strong>starting point</strong> for your own experiments with Stable Diffusion and Volta. Learn more by reading other pages in this documentation.</p></div>',40),f=[g];function b(w,v,_,k,y,P){return o(),s("div",null,f)}const S=a(h,[["render",b]]);export{M as __pageData,S as default};
